import React, { Component } from "react";

class Message extends Component {
    render() {
        return(
            <div>
                <h2>{this.props.userName}</h2>
                <p>{this.props.text}</p>
                <p>likes:{this.props.numOfLikes}</p>

            </div>
        )
    }
}
export default Message
